                    <p className="paratwo"> <i className="fas fa-times-circle"></i> {mybase.ptwo}</p>
                    <p className="parathree"> <i className="fas fa-times-circle"></i> {mybase.pthree}</p>
                </div>
            </div>

                )})
            }



        </section>
        );
    }
}

export default Services;
